import React from "react";
import imghome from "./projectimages/img8.png";

const Common=(props)=>{
return(
    <>
    
    <div className="container-fluid">
  <div className="row">
  <div className="col-md-10 mx-auto">
  <div className="row">
    <div className="col-md-6 mt-5 home_head">
    <h1>{props.name}</h1>
      <h2>{props.mainname}</h2>
      <button className="home_btn">{props.btnname}</button>
    </div>
    <div className="col-md-6 mt-5 homeimage_d">
    <img src={imghome} width="300px" height="300px" alt="img1"/>
    </div>
    </div>
    </div>
  </div>
</div>
    </>
)

};
export default Common;
